import React from 'react';
import "./MainVideo.scss"
import videoPlayBtn from '../../Assets/Icons/SVG/Icon-play.svg'
import videoVolumeBtn from '../../Assets/Icons/PNG/Icon-volume.png'
import loaderBtn from "../../Assets/Icons/PNG/Icon-scrubber-control.png"

class MainVideo extends React.Component {


   render () {
    console.log(this.props.mainVideo)
     return (
      <>
         <video className="MainVideo" poster={this.props.mainVideo.image} src={this.props.mainVideo.video}></video> 
         <div>
           <img src={videoPlayBtn}/>
           <img src={videoVolumeBtn}/>
           <img src={loaderBtn}/>
         </div>
      </>
     )
   }
}




export default MainVideo;
